function Add(){
    return(
        <div>
            <h2>Formulaire d'ajout d'un Employée</h2>
                <form>
                <div class="form-group">
                    <label for="nomComp">Entrer votre nom complet:</label>
                    <input type="text" class="form-control" id="nomComp" placeholder="ARRADI Khadija"/>
                </div>
                <div class="form-group">
                    <label for="email">Another label</label>
                    <input type="text" class="form-control" id="email" placeholder="Another input"/>
                </div>
                </form>
        </div>
    )
}

export default Add;
